import React from 'react';
import '../Registration/Registration.css';

class Login extends React.Component{
    render() {
    
            return (
              <div className="register">
                   <div className="background"></div>
                  <div className="background2"></div>
                   <div className="loginForm"> 
                        <hgroup>
                        <h1>True Taxes Register</h1>
                        {/* <span class="icon novi-icon icon-circle icon-bordered icon-lg icon-default mdi mdi-account-multiple-outline"></span> */}
                        </hgroup>
                        <form>
                        <div className="group">
                            <input type="text" placeholder="Name" class="tname"/><span className="highlight"></span><span className="rbar"></span>
                            {/* <label>Username</label> */}
                        </div>
                        <div className="group">
                            <input type="email" placeholder="Email" class="temail"/><span className="highlight"></span><span className="rbar"></span>
                            {/* <label>Username</label> */}
                        </div>
                        <div className="group">
                            <input type="text" placeholder="Mobile No" class="tmobile"/><span className="highlight"></span><span className="rbar"></span>
                            {/* <label>Password</label> */}
                            <button class="btn btn-deluge btn-sm" id="verifymobileno" name="verifymobileno" type="button">Verify</button>
                        </div>
                        <div className="group">
                            <input type="text" placeholder="Verify Code" class="tvcode"/><span className="highlight"></span><span className="rbar"></span>
                            {/* <label>Password</label> */}
                        </div>
                        <div className="group">
                            <input type="password" placeholder="Password" class="tpass"/><span className="highlight"></span><span className="rbar"></span>
                            {/* <label>Password</label> */}
                        </div>
                        <div className="group">
                            <input type="password" placeholder="Confirm Password" class="tpass"/><span className="highlight"></span><span className="rbar"></span>
                            {/* <label>Password</label> */}
                        </div>
                        <button type="button" className="buttonui "> <span> Create Account </span>
                                <div className="ripples buttonRipples"><span className="ripplesCircle"></span></div>
                            </button>        
                        </form>
                        <div className="powered">
                            <a href="http://www.kvcodes.com"> Create New Register </a>
                        </div>
                    </div>
              </div>
            );
          }
}
export default Login;
